import React, { Component, useEffect, useState } from "react";
import "./css_admin.css";
import { Box, Container } from '@mui/system';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import { Navigate } from 'react-router-dom';

function MotorcycleInfoAdmin() {
  const [items,setItems] = useState([]);
  useEffect(()=>{
    fetch("http://localhost:3001/api/v1/motorcycles")
    .then(res=> res.json())
    .then(
      (result)=>{
        setItems(result);
      }
    )
  })
  const [gotoAddMotorcycle,setGotoAddMotorcycle] = React.useState(false);
  if(gotoAddMotorcycle){
      return <Navigate to = "/admin/add-motorcycle" />;
  }
  return( 
  <div>
    <p>MotorcycleInfoAdmin</p>
    <div>
          <button onClick={()=>{setGotoAddMotorcycle(true);}}>
        ไปจ้า
    </button></div>
    { <React.Fragment>
        <Container maxWidth = "lg" sx={{p:2}}>
          <Box display = "flex">
              <Box sx ={{flexGrow : 1 }}>Item 1</Box>
              <Box>Item</Box>
        </Box>
        </Container>
      <Table sx={{ minWidth: 650 }} size="small" aria-label="a dense table">
        <TableHead>
          <TableRow>
            <TableCell>Dessert (100g serving)</TableCell>
            <TableCell>Dessert (100g serving)</TableCell>
            
          </TableRow>
        </TableHead>
        <TableBody>
          {items.map((row) => (
            <TableRow
              key={row.name}
              sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
            >
              <TableCell component="th" scope="row">{row.MOTORCYCLE_ID}</TableCell>
              <TableCell component="th" scope="row">{row.MOTORCYCLE_BRAND}</TableCell>
             
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </React.Fragment> }
    </div>
  
  );
}

export default MotorcycleInfoAdmin;
